import React from 'react';
import PlaceCard from './exp-card';
import { expData } from './placesData';
function Experiences(){
return(
    
    <div>

    <div className="pics">
        {expData.map((e)=>{
            return(
                <PlaceCard img={e.img} desc={e.desc} place={e.place} days={e.days} distance={e.distance} onClick={()=>{window.location.pathname=e.link}}  />
            );
        }
        )}
        </div>
        </div>
)
}
export default Experiences;
